import React from "react";
import KeeperFoto from "../images/KeeperAppTest.png";

function Projects(props) {
  return (
    <div className="projectTile">
      <a href="https://www.google.com">
      <img src></img>
      </a>
      <div>
        <h1>{props.title}</h1>
      </div>
      <div>
        <h4>{props.components}</h4>
      </div>
      <div>
        <p>{props.text}</p>
      </div>
      
    </div>
  );
}

export default Projects;
